// Inputs key
// Outputs
ub4 hash(ub4 key[], int len)
{
  ub4 h = 0;
  int i;
  for (i=0; i<len; ++i) {
    h += key[i];
    h += (h<<10);
    h ^= (h>>6);
  }

  h += (h<<3);
  h ^= (h>>11);
  h += (h<<15);

  return h;
}


